void LargeSample() {
  LOG_INFO << "Testing specific base64 file";

  char unescaped[64 * 1024];

  // unescape that massive blob above
  size_t size = Base64Unescape(SpecificTest,
    sizeof(SpecificTest),
    unescaped,
    sizeof(unescaped));

  (size, sizeof(testbase64));
  (0, memcmp(testbase64, unescaped, sizeof(testbase64)));
}

bool DecodeTest(const char* encoded, size_t expect_unparsed,
  const char* decoded, aos::Base64::DecodeFlags flags)
{
  std::string result;
  size_t consumed = 0, encoded_len = strlen(encoded);
  bool success = aos::Base64::DecodeFromArray(encoded, encoded_len, flags,
    &result, &consumed);
  size_t unparsed = encoded_len - consumed;
  LOG_INFO << "\"" << encoded
    << "\" -> \"" << decoded
    << "\"";
  (decoded, result.c_str());
  return success;
}

#define Flags(x,y,z) \
  aos::Base64::DO_PARSE_##x | aos::Base64::DO_PAD_##y | aos::Base64::DO_TERM_##z

void DecodeParseOptions() {
  // Trailing whitespace
  (DecodeTest("YWJjZA== ", 1, "abcd", Flags(STRICT, YES, CHAR)));
  (DecodeTest("YWJjZA== ", 0, "abcd", Flags(WHITE, YES, CHAR)));
  (DecodeTest("YWJjZA== ", 0, "abcd", Flags(ANY, YES, CHAR)));

  // Embedded whitespace
  (DecodeTest("YWJjZA= =", 3, "abcd", Flags(STRICT, YES, CHAR)));
  (DecodeTest("YWJjZA= =", 0, "abcd", Flags(WHITE, YES, CHAR)));
  (DecodeTest("YWJjZA= =", 0, "abcd", Flags(ANY, YES, CHAR)));

  // Embedded non-base64 characters
  (DecodeTest("YWJjZA=*=", 3, "abcd", Flags(STRICT, YES, CHAR)));
  (DecodeTest("YWJjZA=*=", 3, "abcd", Flags(WHITE, YES, CHAR)));
  (DecodeTest("YWJjZA=*=", 0, "abcd", Flags(ANY, YES, CHAR)));

  // Unexpected padding characters
  (DecodeTest("YW=JjZA==", 7, "a", Flags(STRICT, YES, CHAR)));
  (DecodeTest("YW=JjZA==", 7, "a", Flags(WHITE, YES, CHAR)));
  (DecodeTest("YW=JjZA==", 0, "abcd", Flags(ANY, YES, CHAR)));
}

void DecodePadOptions() {
  // Padding
  (DecodeTest("YWJjZA==", 0, "abcd", Flags(STRICT, YES, CHAR)));
  (DecodeTest("YWJjZA==", 0, "abcd", Flags(STRICT, ANY, CHAR)));
  (DecodeTest("YWJjZA==", 2, "abcd", Flags(STRICT, NO, CHAR)));

  // Incomplete padding
  (DecodeTest("YWJjZA=", 1, "abcd", Flags(STRICT, YES, CHAR)));
  (DecodeTest("YWJjZA=", 1, "abcd", Flags(STRICT, ANY, CHAR)));
  (DecodeTest("YWJjZA=", 1, "abcd", Flags(STRICT, NO, CHAR)));

  // No padding
  (DecodeTest("YWJjZA", 0, "abcd", Flags(STRICT, YES, CHAR)));
  (DecodeTest("YWJjZA", 0, "abcd", Flags(STRICT, ANY, CHAR)));
  (DecodeTest("YWJjZA", 0, "abcd", Flags(STRICT, NO, CHAR)));
}

void DecodeTerminateOptions() {
  // Complete quantum
  (DecodeTest("YWJj", 0, "abc", Flags(STRICT, NO, BUFFER)));
  (DecodeTest("YWJj", 0, "abc", Flags(STRICT, NO, CHAR)));
  (DecodeTest("YWJj", 0, "abc", Flags(STRICT, NO, ANY)));

  // Complete quantum with trailing data
  (DecodeTest("YWJj*", 1, "abc", Flags(STRICT, NO, BUFFER)));
  (DecodeTest("YWJj*", 1, "abc", Flags(STRICT, NO, CHAR)));
  (DecodeTest("YWJj*", 1, "abc", Flags(STRICT, NO, ANY)));

  // Incomplete quantum
  (DecodeTest("YWJ", 0, "ab", Flags(STRICT, NO, BUFFER)));
  (DecodeTest("YWJ", 0, "ab", Flags(STRICT, NO, CHAR)));
  (DecodeTest("YWJ", 0, "ab", Flags(STRICT, NO, ANY)));
}

void GetNextBase64Char() {
  // The table looks like this:
  // "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/"
  char next_char;
  (aos::Base64::GetNextBase64Char('A', &next_char));
  ('B', next_char);
  (aos::Base64::GetNextBase64Char('Z', &next_char));
  ('a', next_char);
  (aos::Base64::GetNextBase64Char('/', &next_char));
  ('A', next_char);
  (aos::Base64::GetNextBase64Char('&', &next_char));
  (aos::Base64::GetNextBase64Char('Z', NULL));
}

